import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";

const Sidebar = () => {
  return (
    <div class="">
      <div class="row ">
        <h2 className="p-4">Bukit Vista</h2>
      </div>
      <div class="row ">
        <div
          style={{ height: "100vh", background: "#2e053b", color: "white" }}
          class="col-md-2 full-height "
        >
          <h4 className="p-5" style={{ color: "white" }}>
            Guest Portal
          </h4>
        </div>
        <div style={{height:"100vh"}} class="col-md-10 d-flex justify-content-center ">
            <div>    <h5 className="mt-5">Your booking code</h5></div>
      
        </div>
      </div>
    </div>
  );
};

export default Sidebar;
